import { PopularProjects } from "./Data";
import PopularProject from "./PopularProject";


export default function Popular (){
    return (
        <div>
            <div className="section-title">Pu</div>
            {PopularProjects.map(p => (
            <PopularProject {...p} />
            ))
            }
        </div>

      );
}
